import React from "react";
import { Link } from "react-router-dom";
import "./Header.css";

const Header = () => {
  return (
    <header className="header">
      <div className="nav">
        <div className="logo">
          <a href="/">SOHAIB</a>
        </div>
        <div className="mid">
          <ul>
            <li> <Link to="/"> Home</Link></li>
          </ul>
          <ul>
            <li>Portfolio</li>
          </ul>
          <ul>
            <li>Services</li>
          </ul>
          <ul>
            <li>Contact Us</li>
          </ul>
        </div>
        <div className="right">
          <button className="btn">Login</button>
          <button className="btn">SignUp</button>
        </div>
      </div>
    </header>
  );
};

export default Header;
